import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

const App = () => {
  return (
    <View>
      <UpperImage/>
      <LowerText good="bad"/>
    </View>
  );
}

const UpperImage = () => {
  return (
    <View style={styles.upperpart}>
      <Image
        source={{
          uri: 'https://food.fnr.sndimg.com/content/dam/images/food/fullset/2018/5/16/0/FNK_WATERMELON-PIG-H_s4x3.jpg.rend.hgtvcom.406.406.suffix/1526483893553.jpeg'
        }}
        style={{width: 200, height:200}}
      />
    </View>
  )
}

const LowerText = props => {
  return (
    <View style={styles.lowerpart}>
      <Text>I am {props.good}</Text>
    </View>
  )
}

const styles = StyleSheet.create({
  upperpart: {
    flex: 1,
    // backgroundColor: '#ff6e83',
    alignItems: 'center',
    justifyContent: 'center',
  },
  lowerpart: {
    flex: 1,
    // backgroundColor: '#ff6e83',
    alignItems: 'center',
    justifyContent: 'center',
  }
});


export default App
